{"operationName":"leaderboards","variables":{},"query":"query leaderboards {
  leaderboards {
    name
    items {
      decisionsCount
      rank
      ... on Company {
        slug
        name
        path
        imageUrl
        __typename
      }
      ... on Tool {
        name
        slug
        imageUrl
        __typename
      }
      ... on User {
        username
        displayName
        imageUrl
        title
        companyName
        __typename
      }
      __typename
    }
    __typename
  }
}
"}
